import React from 'react';
import Slideshow from './Slideshow';
import Footer from './Footer';


const Form = () => {
  return(
    <React.Fragment>
      <span id="form"></span>
      <div className="h-100 offset-md-1 col-md-10 align-self-center mt-5">
        <div className="row h-100">
          <h1 className="h-25 col-md-12 text-center mt-5" style={{color:'white'}}><strong>Forms</strong></h1>
          <Slideshow />
        </div>
      </div>
      <Footer />
    </React.Fragment>
  );
}


export default Form;
